import React from 'react'
import { connect } from 'react-redux'
import { firestoreConnect } from 'react-redux-firebase'
import { compose } from 'redux'

const ProjectDetail = (props) => {

    const id = props.match.params.id;
    console.log(props);
    return (
        <div className =' container section project-details'>
            <div className = 'card z-depth-0'>
            <div className = 'card-content'>
                <span ClassName ='card-title'>Project Title -{id}</span>
                <p> It might have happened so many times that you or someone yours need doctors help immediately, but they are not available due to some reason. The Health Prediction system is an end user support and online consultation project. Here we propose a system that allows users to get instant guidance on their health issues through an intelligent health care system online. The system is fed with various symptoms and the disease/illness associated with those systems. The system allows user to share their symptoms and issues. It then processes users symptoms to check for various illness that could be associated with it. Here we use some intelligent data mining techniques to guess the most accurate illness that could be associated with patient’s symptoms. If the system is not able to provide suitable results, it urges users to go for blood test, xray, citi scan or which ever report it feels user’s symptoms are associated with, so next time user may be able to login and upload an image of those reports. The system also has a doctor login, these uploaded images are now sent</p>
            </div>
            <div className ='card-action grey lighten-4 grey-text'>
                <div>Posted by Priyanka shriwas</div>
                <div>28 march 12:30 PM</div>
            </div>
            </div>
        </div>
    )
}

const mapStateToProps = (state ,ownProps) => {
    console.log(state);
    const id = ownProps.match.params.id;
    const projects = state.firestore.data.projects;
    const project = projects ? projects[id] : null
    return {
        project : project
    }

}
export default compose(
    connect(mapStateToProps),
    firestoreConnect([
        {collection :'projects'}
    ])
)(ProjectDetail)
